import React from "react";
import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  headerPreco: {
    width: "100%",
    height: "auto",
    alignItems: "center",
  },
  precoatual: {
    color: "#FFFFFF",
    fontSize: 32,
    fontWeight: "bold",
    paddingTop: 20,
  },
  subtitulo: {
    color: "#FFFFFF",
    fontSize: 16,
    fontWeight: "bold",
    paddingTop: 5,
  },
});

export default styles;
